script: |
  super -f text -I q13261.spq | sort > q13261.out

inputs:
  - name: q13261.spq
    data: |
      SELECT DISTINCT - col1 FROM tab0 (FORMAT parquet) WHERE NOT - 71 * + col2 + - - col1 BETWEEN 33 / col1 * col0 AND NULL;
  - name: tab0

outputs:
  - name: q13261.out
    data: |
      -1
      -21
      -81
